import {
  Box,
  Button,
  CardContent,
  CircularProgress,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TablePagination
} from "@material-ui/core";
import React, { useEffect, useState } from "react";

import api from  "../service/api";

export const AppList = () => {
  const [users, setUsers] = useState([]);


  useEffect(() => { 
    const result =  api.get('usuarios');
    setUsers(result.data)
   }, []);

  return (
    <div>
     <ul>
      {users.map(item => (
        <li key={item.id}>
          <strong>EMAIL:</strong>
            <p>{users.email}</p>

        </li>
      ))}
    </ul>

    </div>
  );
};
